import avatarIcon from '../assets/images/default-avatar.svg';

export const defaultAvatar = (param: any) => {
  if (
    param === null ||
    param === undefined ||
    param === '' ||
    param === 'empty' ||
    param === 'N/A'
  ) {
    return avatarIcon;
  } else {
    return param;
  }
};
